(1336508889735426049, 'spiderman', 'GSCinemas', '2020-12-09 04:12:05', 'The #Spiderman Multiverse is getting even more exciting! \n\nAfter the confirmation of Jamie Foxx coming back as Electro, Alfred Molina is now confirmed to return as Doctor Octopus in the next Spider-Man film too! \n\n#Spiderman3 is expected to release in GSC December 2021! ', 'https://t.co/RS5Q3lCLUI', 892, 358, 'Spiderman , Spiderman3', ''),
