(1336538430134603776, 'spiderman', 'TomTaylorMade', '2020-12-09 06:09:28', 'The cashless debit card is an attack on Australian people by the increasingly cruel Morrison government.\nInstead of giving to those who need it, these heartless thugs are taking more from them - their autonomy.\n#SpiderMan learned this lesson as a child.\n#RejectCDCRex #Auspol ', 'https://t.co/w0ToQwsGIG', 628, 128, 'SpiderMan , RejectCDCRex , Auspol', ''),
