(1336932646669099008, 'cyberpunk', 'MegaRan', '2020-12-10 08:15:56', 'I‚Äôm kinda mad at the #Cyberpunk customization options. I can choose the size of my genitals but there are NO OPTIONS FOR DIFFERENT BODY TYPE?!? No fatties in the future, eh. Word. ', 'https://t.co/zCWnQXxU7u', 323, 36, 'Cyberpunk', ''),
(1336935208361353216, 'obama', 'JillWineBanks', '2020-12-10 08:26:07', 'Listen to a fun, enlightening podcast w @PeteSouza. I wore a special #JillsPin for him: a camera. Talked about his career, #Obama, #Reagan, his books &amp; documentary, and he gave me advice on writing a photo book about what my pins tell about the Trump administration. https://t.co/UWUzKbEBBV ', 'https://t.co/SYqWRWAtO2', 383, 48, 'JillsPin , Obama , Reagan', 'PeteSouza'),
