(1336945349320204289, 'BillGates', 'piersmorgan', '2020-12-10 09:06:25', 'Hi Wayne, yes, @BillGates paid me $1 billion to big up the vaccines so that we could implant a chip inside you, control your brain, &amp; turn you into a village idiot. And it\'s clearly working! ', 'https://t.co/ipROKZViA9', 8181, 244, '', 'BillGates'),
